DELIMITER //

CREATE PROCEDURE `retirar_jugador`(IN `jugador_id_param` INT)
BEGIN
    DECLARE fecha_actual DATE;
    SET fecha_actual = CURDATE();

    -- Mover jugador a la tabla de históricos
    SELECT jugador_id, nom, cognom, data_naixement, alcada, pes, dorsal, posicio, equip_id, fecha_actual
    FROM jugadors
    WHERE jugador_id = jugador_id_param;

    -- Mover estadísticas del jugador a la tabla de históricos
    SELECT jugador_id, partit_id, j.nom, j.cognom, minuts_jugats, punts, tirs_anotats, tirs_tirats, tirs_triples_anotats, tirs_triples_tirats, tirs_lliures_anotats, tirs_lliures_tirats, rebots_ofensius, rebots_defensius, assistencies, robades, bloqueigs, fecha_actual
    FROM estadistiques_jugadors ej
    JOIN jugadors j ON ej.jugador_id = j.jugador_id
    WHERE ej.jugador_id = jugador_id_param;

    -- Eliminar estadísticas del jugador de la tabla original
    DELETE FROM estadistiques_jugadors
    WHERE jugador_id = jugador_id_param;

    -- Eliminar el jugador de la tabla original
    DELETE FROM jugadors
    WHERE jugador_id = jugador_id_param;
END //

